angular.module("app").controller("CollectorCreate",["$scope","$state","Collector","API","Auth","UI",function(e,o,t,c,r,l){r.Check(function(){e.collector={project:e.Project.selected._id},e.submit=function(){c.Query(t.add,e.collector,function(e){e.code?l.AlertWarning(e.message):o.go("admin.collector.info")},function(e){l.AlertError(e.data.message)})},e.isEdit=!1})}]);